<html lang="en">
<head>

    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>My Zeitgeist Tarot Journal</title>
    <script src="https://cdn.tailwindcss.com"></script>

    <style>
        body { background-color: #0f0f13; color: #e2e8f0; font-family: 'Lato', sans-serif; }
        .tarot-font { font-family: 'Cinzel', serif; }
        ::-webkit-scrollbar { width: 6px; }
        ::-webkit-scrollbar-track { background: #1a1a2e; }
        ::-webkit-scrollbar-thumb { background: #4c1d95; border-radius: 4px; }

<body class="p-8 flex flex-col items-center min-h-screen">
    <h1 class="text-4xl text-purple-300 tarot-font mb-8">Tarot Journal Export</h1>
    
    <!-- Main Viewer -->
    <div id="mainViewer" class="mb-12 w-full max-w-md hidden">
        <div class="border-2 border-amber-600 rounded-xl overflow-hidden bg-gray-900 shadow-2xl relative">
            <button onclick="document.getElementById('mainViewer').classList.add('hidden')" class="absolute top-2 right-2 bg-black/50 text-white p-2 rounded-full hover:bg-red-900/80">âœ•</button>
            <img id="exportImage" class="w-full h-auto object-cover border-b border-amber-800">
            <div class="p-6">
                <h2 id="exportTitle" class="text-2xl text-amber-400 tarot-font mb-2 border-b border-gray-700 pb-2"></h2>
                <div id="exportKeywords" class="flex gap-2 mb-4 flex-wrap"></div>
                <p id="exportFortune" class="text-gray-300 italic mb-4"></p>
                <div class="text-xs text-gray-500 border-t border-gray-800 pt-2 flex justify-between">
                    <span>Topic: <span id="exportTopic" class="text-purple-400 font-bold"></span></span>
                    <span id="exportDate"></span>
                </div>
            </div>
        </div>
    </div>

        function viewCard(index) {
            const entry = journalData[index];
            document.getElementById('mainViewer').classList.remove('hidden');
            document.getElementById('exportImage').src = entry.image;
            document.getElementById('exportTitle').textContent = entry.title;
            document.getElementById('exportFortune').textContent = entry.fortune;
            document.getElementById('exportTopic').textContent = entry.topic || 'Unknown';
            document.getElementById('exportDate').textContent = entry.date;
            
            const kwContainer = document.getElementById('exportKeywords');
            kwContainer.innerHTML = '';
            (entry.keywords || []).forEach(w => {
                const span = document.createElement('span');
                span.className = 'text-xs px-2 py-1 bg-purple-900 rounded text-purple-200 border border-purple-700';
                span.textContent = w;
                kwContainer.appendChild(span);
            });
